<template>
  <div class="wrapper">
    <div class="art">
      <canvas id="canvas1"></canvas>
      <!-- <img src="../assets/image1.png" alt="" id="image1"> -->
    </div>
    <div class="donation">
      <p>keep this website and my passion running</p>
    </div>
  </div>
</template>

<script>
export default {
  name: "color",
  setup() {},
  mounted() {
    this.effect();
  },
  methods: {
    effect() {
      // const image1 = document.getElementById("image1") 
      const image1 = new Image()
      image1.src = "data:image/png;base64,";

      function load() {
        const canvas = document.getElementById("canvas1");
        const ctx = canvas.getContext("2d");
        canvas.width = 1210;
        canvas.height = 734;
        const gradient1 = ctx.createLinearGradient(
          0,
          0,
          canvas.width,
          canvas.height / 2
        );
        gradient1.addColorStop(0.2, "pink");
        gradient1.addColorStop(0.3, "red");
        gradient1.addColorStop(0.4, "orange");
        gradient1.addColorStop(0.5, "yellow");
        gradient1.addColorStop(0.6, "green");
        gradient1.addColorStop(0.7, "turquoise");
        gradient1.addColorStop(0.8, "violet");

        let counter = 0;
        setInterval(function() {
          counter++;
        }, 600)

        ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
        const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
        // remove to initialy show image:
        ctx.clearRect(0, 0, canvas.width, canvas.height);

        let particlesArray = [];
        const numberOfParticles = 7000;

        // calculate brightness based on human perception
        function calculateBrightness(red, green, blue) {
          return Math.sqrt(
            red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
          );
        }

        let mappedImage = [];
        for (let y = 0; y < canvas.height; y++) {
          let row = [];
          for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[y * 4 * pixels.width + x * 4];
            const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
            const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
            const brightness = calculateBrightness(red, green, blue) / 70;
            const cellBrightness = brightness;
            const cellColor = `rgb(${red}, ${green}, ${blue})`;
            const cell = [cellBrightness, cellColor];
            row.push(cell);
          }
          mappedImage.push(row);
        }

        class Particle {
          constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.angle = 0;
          }
          update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            if (
              mappedImage[this.position1] &&
              mappedImage[this.position1][this.position2]
            ) {
              this.speed = mappedImage[this.position1][this.position2][0] / 8;
            }
            let movement = 2.5 - this.speed + this.velocity;
            this.angle += this.speed / 5; // change angle (circle size) based on speed
            this.size = this.speed * 4 + 1; // change size based on speed based on brigthness

            // define effect restart
            if (counter % 50 === 0) {
              this.x = Math.random() * canvas.width;
              this.y = 0;
            }

            this.y += movement + Math.sin(this.angle) * 1.8; // change movement
            this.x += movement / 3 + Math.cos(this.angle) * 1; // change movement
            if (this.y >= canvas.height) {
              this.y = 0;
              this.x = Math.random() * canvas.width;
            }
            if (this.x >= canvas.width) {
              this.x = 0;
              this.y = Math.random() * canvas.height;
            }
          }
          draw() {
            ctx.beginPath();
            if (
              mappedImage[this.position1] &&
              mappedImage[this.position1][this.position2]
            ) {
              ctx.fillStyle = mappedImage[this.position1][this.position2][1];
              // ctx.strokeStyle = mappedImage[this.position1][this.position2][1];
            }
            // ctx.fillStyle = gradient1; // color gradient
            // ctx.strokeRect(this.x, this.y, this.size, this.size)
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
          }
        }

        function init() {
          for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle());
          }
        }
        init();
        console.log(particlesArray)

        function animate() {
          ctx.globalAlpha = 0.05;
          ctx.fillStyle = "rgb(0, 0, 0)";
          ctx.fillRect(0, 0, canvas.width, canvas.height);
          for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            // ctx.globalAlpha = particlesArray[i].speed * 0.5;
            ctx.globalAlpha = 1;
            particlesArray[i].draw();
          }
          requestAnimationFrame(animate);
        }
        animate();
      };
      load();
    }
  }
};
</script>

<style lang="scss" scoped>
#canvas1 {
  border: 3px solid white;
  top: 50%;
  left: 50%;
  position: absolute;
  width: 1210px;
  height: 734px;
  transform: translate(-50%, -50%);
  filter: blur(0.5px) contrast(1.05);
}

.donation {
  color: rgb(83, 83, 83);
  position: absolute;
  bottom: 0;
  padding-bottom: 10px;
  width: 100%;

  .donation p {
    text-align: center;
  }
}
</style>
